import axios from 'axios';

export const GET_POKEMONS = 'GET_POKEMONS'

export function getPokemons(page){
    return async () => {
        const data = await axios.get('http://localhost:3001/pokemons')
        return {type: GET_POKEMONS, payload: {data, page}}
    }
}
